    const fecthItem = async () => {
      const results = await axios("https://jsonplaceholder.typicode.com/");
      setItem(results.item);
    };

    fecthItem();
  });

  return (
    <>
      <div>vos element seront ici!</div>
    </>
  );
}
export default App;
